WITH filtered_date AS (SELECT d_date_sk FROM date_dim WHERE d_month_seq BETWEEN 1191 AND 1191 + 23), catalog_sales_join AS (SELECT cs.cs_sold_date_sk, cs.cs_ship_date_sk, w.w_warehouse_name, sm.sm_type, cc.cc_name FROM catalog_sales cs INNER JOIN filtered_date fd ON cs.cs_ship_date_sk = fd.d_date_sk INNER JOIN warehouse w ON cs.cs_warehouse_sk = w.w_warehouse_sk INNER JOIN ship_mode sm ON cs.cs_ship_mode_sk = sm.sm_ship_mode_sk INNER JOIN call_center cc ON cs.cs_call_center_sk = cc.cc_call_center_sk WHERE cs.cs_list_price BETWEEN 244 AND 273 AND w.w_gmt_offset = -5 AND sm.sm_type = 'LIBRARY' AND cc.cc_class = 'medium') SELECT SUBSTRING(w_warehouse_name,1,20), sm_type, cc_name, SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk <= 30) THEN 1 ELSE 0 END) AS "30 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 30) AND (cs_ship_date_sk - cs_sold_date_sk <= 60) THEN 1 ELSE 0 END) AS "31-60 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 60) AND (cs_ship_date_sk - cs_sold_date_sk <= 90) THEN 1 ELSE 0 END) AS "61-90 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 90) AND (cs_ship_date_sk - cs_sold_date_sk <= 120) THEN 1 ELSE 0 END) AS "91-120 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 120) THEN 1 ELSE 0 END) AS ">120 days" FROM catalog_sales_join GROUP BY SUBSTRING(w_warehouse_name,1,20), sm_type, cc_name ORDER BY SUBSTRING(w_warehouse_name,1,20), sm_type, cc_name LIMIT 100